-- 	RETURN concat('LP','-',tahun,bulan,lpad((coalesce(hasil,0) + 1)::varchar,3,'0'));


	SELECT RIGHT(TRIM(loading_plan_number),4) AS INT4 INTO hasil FROM dxb.loading_plan ORDER BY CAST(SUBSTRING(loading_plan_number FROM '(\d+)$') AS INTEGER) DESC LIMIT 1;
	RETURN concat('LP','-',tahun,bulan,lpad((coalesce(CAST(hasil as INT4),0) + 1)::varchar,4,'0'));



END; $BODY$
  LANGUAGE plpgsql VOLATILE
  COST 100;

